import React from "react";
import Emailoutline from "../Emailoutline";
import Belloutline from "../Belloutline";
import Personoutline1 from "../Personoutline1";
import Frame19437 from "../Frame19437";
import Searchoutline1 from "../Searchoutline1";
import Funneloutline1 from "../Funneloutline1";
import Chevronrightoutline1 from "../Chevronrightoutline1";
import Frame375 from "../Frame375";
import Frame3292 from "../Frame3292";
import Frame3374 from "../Frame3374";
import Closeoutline1 from "../Closeoutline1";
import Frame286 from "../Frame286";
import "./X141MessagesPopup.css";

function X141MessagesPopup(props) {
  const {
    library,
    frame1951,
    myDashboard,
    allFiles,
    text191,
    usersCollections,
    savedCollection,
    searchCourses,
    addFiles,
    filterBy,
    articles,
    videos,
    number,
    leftCenterTip,
    text237,
    business,
    rectangle1194,
    vector,
    vector2,
    added,
    addTo,
    yourMessages,
    emailoutlineProps,
    belloutlineProps,
    personoutline1Props,
    frame19437Props,
    searchoutline1Props,
    funneloutline1Props,
    chevronrightoutline1Props,
    chevronrightoutline12Props,
    frame375Props,
    frame3752Props,
    frame3753Props,
    frame3754Props,
    frame3755Props,
    frame194372Props,
    frame3292Props,
    frame3374Props,
    frame33742Props,
    frame33743Props,
    closeoutline1Props,
    frame286Props,
  } = props;

  return (
    <div className="x14-1-messages-popup screen ">
      <div className="group-19435">
        <div className="frame-19548">
          <div className="library">{library}</div>
          <Emailoutline layer22Props={emailoutlineProps.layer22Props} className="email-outline2" />
          <Belloutline vector={belloutlineProps.vector} vector2={belloutlineProps.vector2} className="bell-outline2" />
          <div className="frame-19518" style={{ backgroundImage: `url(${frame1951})` }}></div>
          <div className="frame-28489">
            <Personoutline1
              vector={personoutline1Props.vector}
              vector2={personoutline1Props.vector2}
              vector3={personoutline1Props.vector3}
            />
            <div className="my-dashboard inter-medium-quarter-spanish-white-16px">{myDashboard}</div>
          </div>
        </div>
        <Frame19437
          frame1945Props={frame19437Props.frame1945Props}
          frame19442Props={frame19437Props.frame19442Props}
          frame1947Props={frame19437Props.frame1947Props}
          frame1948Props={frame19437Props.frame1948Props}
          frame2303Props={frame19437Props.frame2303Props}
          group1943Props={frame19437Props.group1943Props}
        />
        <div className="frame-2981">
          <div className="frame-19836 border-1px-quarter-spanish-white">
            <div className="all-files">{allFiles}</div>
          </div>
          <div className="frame-1984 border-class-2">
            <div className="text-191 inter-medium-quarter-spanish-white-16px">{text191}</div>
          </div>
          <div className="frame-1985 border-class-2">
            <div className="users-collections inter-medium-quarter-spanish-white-16px">{usersCollections}</div>
          </div>
          <div className="frame-1986 border-class-2">
            <div className="saved-collection inter-medium-quarter-spanish-white-16px">{savedCollection}</div>
          </div>
        </div>
        <div className="frame-3265 border-1px-onyx">
          <div className="frame-29132">
            <Searchoutline1 vector={searchoutline1Props.vector} vector2={searchoutline1Props.vector2} />
            <div className="search-courses">{searchCourses}</div>
          </div>
        </div>
        <div className="frame-1983-1">
          <div className="add-files">{addFiles}</div>
        </div>
        <div className="frame-19892 border-1px-onyx">
          <div className="frame-28172">
            <Funneloutline1 vector={funneloutline1Props.vector} vector2={funneloutline1Props.vector2} />
            <div className="filter-by inter-medium-quarter-spanish-white-16px">{filterBy}</div>
          </div>
          <Chevronrightoutline1 layer24Props={chevronrightoutline1Props.layer24Props} />
          <Chevronrightoutline1
            layer24Props={chevronrightoutline12Props.layer24Props}
            className="chevron-right-outline-12"
